//www.instagram.com/ayb_aast/",w:"Error handler must accept one Object or one Object and a StackTrace as arguments, and return a value of the returned future's type",e:"Expandos are not allowed on strings, numbers, booleans or null",O:"Failed to load network image.\nImage URL: ",v:"Fill out our form to be a part of our community of individuals dedicated to creating positive change. Together, we can create a brighter future for all.",l:"Host platform returned null value for non-null return value.",F:"If you call us at 01029298885, one of our representatives will be happy to answer your call and help you with your donation. We can collect your donation from the nearest point or even from your home for your convenience.",N:"In 2014, the NGO had a significant year, marking the beginning of several impactful initiatives. They launched a blanket distribution event, providing warmth and comfort to our families in Bolaq. Additionally, they distributed Ramadan bags filled with essential food items, furthering their mission to alleviate hunger in the community. Most notably, they started their first medical convoy, providing healthcare services and assistance to underserved communities. These initiatives demonstrate the NGO's dedication to making a positive impact and improving the lives of those in need.",A:"In 2016, a truly impactful and heartwarming event called 'Keswa'. The event was organized with the sole aim of providing clothing to our families in Bolaq who were in need. The 'Keswa' event enabled the families to pick out clothes that they needed, and it was truly an amazing experience to see the joy and happiness on their faces. The act of providing clothing to those who are less fortunate is a deeply charitable and selfless act. The 'Keswa' event was a symbol of hope and kindness, and it goes to show that a small act of kindness can go a long way in making a difference in people's lives. The initiative brought a sense of community and togetherness, and it is a testament to the fact that we can all make a difference in this world.",B:"In 2017, a wonderful opportunity was provided for the children of Bolaq families to visit the pyramids of Giza, one of the most beautiful and historic sites in Egypt. This trip aimed to instill a love for their country and heritage in these children. In addition to this, Ramadan bags filled with food and supplies were distributed to those in need, bringing a little bit of joy and comfort to their lives. It is through such acts of kindness and generosity that we can help make a difference in the lives of those less fortunate and bring a smile to their faces.",_:"In 2019, we had the opportunity to collaborate with other franchises for our annual Ramadan Bags packing. It was a wonderful experience to work together towards a common goal of providing essential supplies to those in need during the holy month. Through this collaboration, we were able to reach a wider audience and make an even greater impact in our community. In addition to the Ramadan Bags packing, we also joined forces with other universities for a Medical Convoy. The collaboration allowed us to bring medical care and services to even more people in underserved areas, demonstrating the power of working together towards a greater cause. We believe that collaboration is key in achieving our mission to help those in need and create positive change in our community.",V:"Stream has been disposed.\nAn ImageStream is considered disposed once at least one listener has been added and subsequently all listeners have been removed and no handles are outstanding from the keepAlive method.\nTo resolve this error, maintain at least one listener on the stream, or create an ImageStreamCompleterHandle from the keepAlive method, or create a new stream for the image.",p:"SystemChrome.setApplicationSwitcherDescription",s:"TextInputClient.updateEditingStateWithDeltas",m:"TextInputClient.updateEditingStateWithTag",W:"Thank you for your generous donation! We ki